typedef union
{
    int i;
    float f;
} u;

int main()
{

    for(int i = 0; i < 100; i++){
        for(int j = 0;j < 295; j++){
            cout << children_left_arr[i][j];
            cout << children_right_arr[i][j];
            for(int k = 0; k < 100; k++){
                cout << value_arr[i][j][k];
            }
        }
    }
    
    u X[86];
    for (int i = 0; i < 86; i++)
    {
        float in;
        cin >> in;
        X[i].f = in;
    }

    int word_cnt;
    int inputs_hex[86];
    int output[9] = {0, 0, 0, 0, 0, 0, 0, 0, 0};
    //ap_uint<8> sum = 0; // using arbitrary precision
    for (int i = 0; i < 86; i++)
    {
        inputs_hex[i] = X[i].i;
    }

    int forest_probability[9] = {0};
    for (int i = 0; i < 100; i++)
    {
        int curr = 0; //current node
        int tree_probability[9] = {0};
        for (int d = 0; d < max_depth_arr[i]; d++)
        {
            if (children_left_arr[i][curr] == children_right_arr[i][curr])
            {
                //leaf node
                float sum_values = 0;
                for (int v = 0; v < 8; v++)
                {
                    sum_values += value_arr[i][curr][v];
                }
                for (int v = 0; v < 8; v++)
                {
                    tree_probability[v] = round(value_arr[i][curr][v] / sum_values);
                }
                break;
            }
            else
            {
                //decision node
                u curr_feature;
                curr_feature.i = inputs_hex[feature_arr[i][curr]];
                if (curr_feature.f <= threshold_arr[i][curr])
                {
                    curr = children_left_arr[i][curr];
                }
                else
                {
                    curr = children_right_arr[i][curr];
                }
            }
        }
        for (int j = 0; j < 9; j++)
        {
            forest_probability[j] += tree_probability[j];
        }
    }
    int forest_sum = 0;
    for (int i = 0; i < 9; i++)
    {
        forest_sum += forest_probability[i];
    }
    float outp[9] = {0};
    for (int i = 0; i < 9; i++)
    {
        outp[i] = (float)forest_probability[i] / forest_sum;
    }

    for (int i = 0; i < 9; i++)
    {
        u out;
        out.f = outp[i];
        cout << out.f << ' ';
    }
}
